import React, { useCallback, useEffect } from "react";
import { NavLink, useHistory } from "react-router-dom";
import useAuthStore from "../stores/authStore";

function SideBar(props:any) {

  useEffect(()=>{
    console.log(props.navValue)
  }, [props.navValue])

  const history = useHistory();

  const logout = useAuthStore(useCallback((state) => state.logout, []));

  const _logout = () => {
    logout();
    history.replace("/");
  };

  return (
      <div className="hidden w-3/12 pt-12 border-r bg-white h-full relative lg:inline">
          <div className="flex justify-center mb-20">
              <img src="img/agile-credit-logo-large 1.png" className="w-24" alt="" />
          </div>
          <div className="m-auto w-8/12 mb-16">
              <button className="flex w-full shadow-md text-xl font-light text-white justify-start pt-2 pb-2 items-center bg-blue-700 rounded-md">
                  <img src="img/add_24px_outlined.svg" className="w-6 ml-8" alt="" />
                  <span className="ml-4 xl:text-lg lg:text-sm">
                      Take a loan
                  </span>

              </button>
          </div>
          <div className="w-11/12 ml-auto mb-24">
              <NavLink to="" className="flex bg-indigo-200 p-4 rounded-tl-lg rounded-bl-lg mb-1">
                  <img src="img/dashboard_24px_outlined_menu.svg" className="ml-3" alt="" />
                  <span className="text-blue-700 ml-6 lg:text-sm xl:text-xl font-light">Overview</span>
              </NavLink>
              <NavLink to=""  className="flex p-4 rounded-tl-lg rounded-bl-lg mb-1">
                  <img src="img/account_balance_wallet_24px_outlined_1.svg" className="ml-3" alt="" />
                  <span className="text-gray-700 ml-6 lg:text-sm xl:text-xl font-light">My Loans</span>
              </NavLink>
              <NavLink to="" className="flex p-4 rounded-tl-lg rounded-bl-lg mb-1">
                  <img src="img/how_to_vote_24px_outlined.svg" className="ml-3" alt="" />
                  <span className="text-gray-700 ml-6 lg:text-sm xl:text-xl font-light">Make Payments</span>
              </NavLink>
              <NavLink to="" className="flex p-4 rounded-tl-lg rounded-bl-lg mb-1">
                  <img src="img/file_copy_24px_outlined_1.svg" className="ml-3" alt="" />
                  <span className="text-gray-700 ml-6 lg:text-sm xl:text-xl font-light">My Documents</span>
              </NavLink>
              <NavLink to="" className="flex p-4 rounded-tl-lg rounded-bl-lg mb-1">
                  <img src="img/credit_card_24px_outlined.svg" className="ml-3" alt="" />
                  <span className="text-gray-700 ml-6 lg:text-sm xl:text-xl font-light">Payment Methods</span>
              </NavLink>
          </div>
          <br />
          <div className=" bottom-0 border-t">
              <div className="w-11/12 ml-auto mt-8">
                  <NavLink to="" className="flex p-4 items-center rounded-tl-lg rounded-bl-lg mb-1">
                      <img src="img/24px.png" className="ml-3 w-5 h-5" alt="" />
                      <span className="text-gray-700 ml-6 lg:text-sm xl:text-xl font-light">Visit Website</span>
                  </NavLink>
                  <button onClick={_logout} className="flex p-4 rounded-tl-lg rounded-bl-lg mb-1 focus:outline-none">
                      <img src="img/power_settings_new_24px.png" className="ml-3 w-5 h-5" alt="" />
                      <span className="text-gray-700 ml-6 lg:text-sm xl:text-xl font-light">Logout</span>
                  </button>
              </div>
          </div>
          <br /><br /><br />
      </div>
    // <nav>
    //   <ul>
    //     <li>
    //       <NavLink to="/">Home</NavLink>
    //     </li>
    //     <li>
    //       <NavLink to="/profile">Profile</NavLink>
    //     </li>

    //     <button onClick={_logout}>Logout</button>
    //   </ul>
    // </nav>
  );
}

export default SideBar;
